const canvas = document.createElement('canvas');

canvas.width = 500;
canvas.height = 500;

document.querySelector('body').appendChild(canvas);

// Initialize the GL context
const gl = canvas.getContext('webgl2');

gl.viewport(0,0,canvas.width,canvas.height);

// create program

const vertShader = gl.createShader(gl.VERTEX_SHADER);
gl.shaderSource(vertShader, 
  '#version 300 es\n' +
  'precision mediump float;\n' +
  '\n' +
  'in vec3 coordinates;\n' +
  'in vec2 textureCoordinates;\n' +
  'in float startDegrees;\n' +
  'uniform uint time;\n' +
  'out vec4 color;\n' +
  'out vec2 TextureCoordinates;\n' +
  '\n' +
  'void main()\n' +
  '{\n' +
  '  float rotation = radians(float(time) + startDegrees);\n' +
  '  gl_Position = vec4(coordinates.x + sin(rotation) * 0.1, coordinates.y + cos(rotation) * 0.1, coordinates.z, 1.0);\n' +
  '  color = vec4(sin(rotation), sin(rotation + radians(120.0)), sin(rotation + radians(240.0)), 1);\n' +
  '  TextureCoordinates = textureCoordinates;\n' +
  '}\n'
);
gl.compileShader(vertShader);

if (!gl.getShaderParameter(vertShader, gl.COMPILE_STATUS)) {
  console.error("Vertex shader did not compile successfully: " + gl.getShaderInfoLog(vertShader));
}

const fragShader = gl.createShader(gl.FRAGMENT_SHADER);
gl.shaderSource(fragShader,
  '#version 300 es\n' +
  'precision mediump float;\n' +
  '\n' +
  'in vec4 color;\n' +
  'in vec2 TextureCoordinates;\n' +
  'uniform sampler2D textureData;\n' +
  'out vec4 FragColor;\n' +
  '\n' +
  'void main(void)\n' +
  '{\n' +
  '  FragColor = texture(textureData, TextureCoordinates) * vec4(color) * 99.0;\n' +
  '}\n'
);
gl.compileShader(fragShader);

if (!gl.getShaderParameter(fragShader, gl.COMPILE_STATUS)) {
  console.error("Fragment shader did not compile successfully: " + gl.getShaderInfoLog(fragShader));
}

const prog = gl.createProgram();
gl.attachShader(prog, vertShader);
gl.attachShader(prog, fragShader);
gl.linkProgram(prog);

if (!gl.getProgramParameter(prog, gl.LINK_STATUS)) {
  console.error("Shader program did not link successfully: " + gl.getProgramInfoLog(prog));
}

// create vbo

const vbo = gl.createBuffer();
gl.bindBuffer(gl.ARRAY_BUFFER, vbo);
gl.bufferData(gl.ARRAY_BUFFER, new Float32Array([
  0.5, -0.5, 0.0, 1, 0, 0,
  -0.5, -0.5, 0.0, 0, 0, 90,
  -0.5, 0.5, 0.0, 0, 1, 180,
  0.5, 0.5, 0.0, 1, 1, 270,
]), gl.STATIC_DRAW);

const ea = gl.createBuffer();
gl.bindBuffer(gl.ELEMENT_ARRAY_BUFFER, ea);
gl.bufferData(gl.ELEMENT_ARRAY_BUFFER, new Uint16Array([
  0, 1, 2,
  0, 2, 3,
]), gl.STATIC_DRAW);



const coordinates = gl.getAttribLocation(prog, "coordinates");
gl.vertexAttribPointer(coordinates, 3, gl.FLOAT, false, 6 * 4, 0);
gl.enableVertexAttribArray(coordinates);

const textureCoordinates = gl.getAttribLocation(prog, "textureCoordinates");
gl.vertexAttribPointer(textureCoordinates, 2, gl.FLOAT, false, 6 * 4, 3 * 4);
gl.enableVertexAttribArray(textureCoordinates);

const startDegrees = gl.getAttribLocation(prog, "startDegrees");
gl.vertexAttribPointer(startDegrees, 1, gl.FLOAT, false, 6 * 4, 5 * 4);
gl.enableVertexAttribArray(startDegrees);



const time = gl.getUniformLocation(prog, "time");
const textureData = gl.getUniformLocation(prog, "textureData");

// drawing

var i = 0;

gl.useProgram(prog);
//  

var image = new Image();
image.onload = function () {
  
  gl.activeTexture(gl.TEXTURE0);
  var texture = gl.createTexture();
  gl.bindTexture(gl.TEXTURE_2D, texture);
  gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, image);
  gl.generateMipmap(gl.TEXTURE_2D);
  gl.uniform1i(textureData, 0);

  setInterval(function(){
    gl.clearColor(1, 0, 0, 1);
    gl.clear(gl.COLOR_BUFFER_BIT);
    gl.uniform1ui(time, i++);
    gl.drawElements(gl.TRIANGLES, 6, gl.UNSIGNED_SHORT, 0);
  }, 10);
  

};
image.src = 'data:image/png;base64,';

